import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import heroBg from "../images/hero-bg.jpg";

const Partnership = () => {
  const navigate = useNavigate();
  const [activeTab, setActiveTab] = useState("suggested");
  const [searchParams, setSearchParams] = useState({
    location: "",
    orgType: "",
    description: "",
  });

  const handleTabClick = (tab) => {
    setActiveTab(tab);
  };

  return (
    <div className="min-h-screen bg-white">
      {/* 半透明的 Hero 背景 */}
      <div
        className="relative min-h-[400px] bg-cover bg-center"
        style={{
          backgroundImage: `linear-gradient(rgba(255, 255, 255, 0.9), rgba(255, 255, 255, 0.9)), url(${heroBg})`,
        }}
      >
        {/* 返回按钮 */}
        <button
          onClick={() => navigate(-1)}
          className="absolute top-8 left-8 p-2 text-gray-600 hover:text-gray-900 transition-colors"
        >
          <svg
            className="w-6 h-6"
            fill="none"
            stroke="currentColor"
            viewBox="0 0 24 24"
          >
            <path
              strokeLinecap="round"
              strokeLinejoin="round"
              strokeWidth={2}
              d="M10 19l-7-7m0 0l7-7m-7 7h18"
            />
          </svg>
        </button>

        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 pt-20 pb-12">
          <h1 className="text-4xl font-bold text-center text-gray-900 mb-8">
            Let's Find Your Perfect Partner
          </h1>

          {/* 搜索区域 */}
          <div className="bg-white rounded-lg shadow-lg p-6 max-w-4xl mx-auto">
            <div className="grid grid-cols-1 md:grid-cols-12 gap-4">
              {/* Location */}
              <div className="md:col-span-3">
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Location
                </label>
                <input
                  type="text"
                  className="w-full rounded-md border-gray-300 shadow-sm focus:border-teal-500 focus:ring-teal-500"
                  placeholder="Enter location"
                  value={searchParams.location}
                  onChange={(e) =>
                    setSearchParams({
                      ...searchParams,
                      location: e.target.value,
                    })
                  }
                />
              </div>

              {/* Organization Type */}
              <div className="md:col-span-3">
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Organization Type
                </label>
                <select
                  className="w-full rounded-md border-gray-300 shadow-sm focus:border-teal-500 focus:ring-teal-500"
                  value={searchParams.orgType}
                  onChange={(e) =>
                    setSearchParams({
                      ...searchParams,
                      orgType: e.target.value,
                    })
                  }
                >
                  <option value="">Select type</option>
                  <option value="nonprofit">Nonprofit</option>
                  <option value="forprofit">For-profit</option>
                  <option value="social">Social Enterprise</option>
                </select>
              </div>

              {/* Description */}
              <div className="md:col-span-4">
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  What Kind of Organization Are You Looking For
                </label>
                <input
                  type="text"
                  className="w-full rounded-md border-gray-300 shadow-sm focus:border-teal-500 focus:ring-teal-500"
                  placeholder="Describe your ideal partner"
                  value={searchParams.description}
                  onChange={(e) =>
                    setSearchParams({
                      ...searchParams,
                      description: e.target.value,
                    })
                  }
                />
              </div>

              {/* Search Button */}
              <div className="md:col-span-2 flex items-end">
                <button className="w-full bg-teal-600 hover:bg-teal-700 text-white font-medium py-2 px-4 rounded-md transition-colors">
                  Search
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* 标签页导航 */}
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="border-b border-gray-200">
          <nav className="-mb-px flex space-x-8" aria-label="Tabs">
            <button
              className={`${
                activeTab === "suggested"
                  ? "border-teal-500 text-teal-600"
                  : "border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300"
              } whitespace-nowrap py-4 px-1 border-b-2 font-medium text-sm`}
              onClick={() => handleTabClick("suggested")}
            >
              Suggested Jobs
            </button>
            <button
              className={`${
                activeTab === "applied"
                  ? "border-teal-500 text-teal-600"
                  : "border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300"
              } whitespace-nowrap py-4 px-1 border-b-2 font-medium text-sm`}
              onClick={() => handleTabClick("applied")}
            >
              Applied Jobs
            </button>
            <button
              className={`${
                activeTab === "saved"
                  ? "border-teal-500 text-teal-600"
                  : "border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300"
              } whitespace-nowrap py-4 px-1 border-b-2 font-medium text-sm`}
              onClick={() => handleTabClick("saved")}
            >
              Saved Jobs
            </button>
            <button
              className={`${
                activeTab === "community"
                  ? "border-teal-500 text-teal-600"
                  : "border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300"
              } whitespace-nowrap py-4 px-1 border-b-2 font-medium text-sm`}
              onClick={() => handleTabClick("community")}
            >
              Saved Community
            </button>
          </nav>
        </div>

        {/* 内容区域 */}
        <div className="py-6">
          {/* 这里可以根据 activeTab 显示不同的内容 */}
          <div className="grid grid-cols-1 gap-6 sm:grid-cols-2 lg:grid-cols-3">
            {/* 示例卡片 */}
            <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-6">
              <h3 className="text-lg font-medium text-gray-900">
                Sample Organization
              </h3>
              <p className="mt-2 text-sm text-gray-500">
                Looking for partnership in environmental protection...
              </p>
            </div>
            {/* 可以添加更多卡片 */}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Partnership;
